import { Component } from '@angular/core';

@Component({
  selector: 'app-friend',
  templateUrl: './friend.component.html',
  styleUrls: ['./friend.component.css'],
})
export class Friend {
  constructor(
    public id: number,
    public firstname: string,
    public lastname: string
  ) {}
}

export class FriendComponent {}
